import React from "react"
import { Link } from "react-router-dom";

export default function HomeIcon() {
    return (
        <div>
            <Link 
                to={"/"}
                style={{
                    fontFamily: "georgia, serif",
                    fontSize: 50,
                    textDecoration:"none",
                    color:"darkblue"
                }}
            >
                nanovert
            </Link>
            <br />
            <br />
        </div>
    )
}
